            </div>
            <di className="card-body">
                
                <h4 className="card-title">{title}</h4>
                <p className="card-text text-secondary">Lorem Ipsum es simplemente el texto de relleno de las imprentas y archivos de texto. Lorem Ipsum ha sido el texto de relleno estándar de las industrias desde el año 1500, cuando un impresor (N. del T. persona que se dedica a la imprenta) </p>
                <a href="" className="btn btn-outline-secondary rounded-0">
                    Go to this website
                </a>
            </di>
        </div>
    )
}
export default Card;
